import React from 'react';
import { Link } from 'react-router-dom';

function HomePage() {
 
    return (
        <div className="col-lg-8 offset-lg-2">
            <h1>Hi !</h1>
           
            <p>
                <Link to="/login">Logout</Link>
            </p>
        </div>
    );
}

export { HomePage };
